import React from 'react'

const Track = (props) => {
    const { result } = props;

    return (
        <div className="col-md-6">
            <div className="card mb-4 shadow-sm">
                <div className ="card-body">

                    <h5>{result.artist}</h5>
                </div>
            </div>

        </div>
    )
}
export default Track;
